import React from 'react';
import { useParams } from 'react-router';
import { Container } from 'reactstrap';

const Profile = () => {
  let { id } = useParams();
  console.log(id);
  return (
    <Container>
      <h4 className='pt-4 pb-5'>Dealer's Profile</h4>
      <h4>{id}</h4>
    </Container>
  );
};

export default Profile;
